import World from "./World";
import styles from "./Hello.module.css";

const Hello = function () {
  return (
    <div>
      <h1
        style={{
          color: "#f00",
          borderRight: "2px solid #000",
          marginTop: "30px",
          opacity: 0.5,
        }}
      >
        Hello
      </h1>
      <div className="box">Hello</div>
    </div>
  );
};

export default Hello;
